import React, { useState } from "react";
import AppBarHeader from "./AppBar/AppBarHeader";
import Drawer from "./Drawer/Drawer";
import DrawerHeader from "./Drawer/DrawerHeader";
import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import { useTheme } from '@mui/material/styles';
import Registration from "./Login/Registration";
import Login from "./Login/Login";
import Suppliers from "./Suppliers/Suppliers";
import { Route, Routes } from 'react-router-dom';
import Typography from '@mui/material/Typography';
import Agencies from "./Agencies/Agencies";

import LoginRegistration from './Componants/Login/LoginRegistration';


import About from './Componants/AppBar/About';
import Departments from './Componants/Departments/Departments';

import Customers from './Componants/Customers/Customers';
import Workers from './Componants/Workers/Workers';

import Items from './Componants/Items/Items';
import Photos_Posters from './Componants/Photos_Posters/Photos_Posters';
import Models from './Componants/Models/Models';
import Messages from './Componants/Messages/Messages';
import Notifications from './Componants/Notifications/Notifications';



const Home = () => {

    const drawerWidth = 210;
    const theme = useTheme();
    const [open, setOpen] = React.useState(false);

    const handleDrawerOpen = () => {
        setOpen(true);
    };
    const handleDrawerClose = () => {
        setOpen(false);
    };

    const [isLoggedIn, setIsLoggedIn] = useState(true)
    return (
        <React.Fragment>
            <Box sx={{ display: 'flex' }} >
                <CssBaseline />
                <AppBarHeader drawerwidth={drawerWidth} open={open} onOpen={handleDrawerOpen} />
                <Drawer drawerwidth={drawerWidth} open={open} theme={theme} onClose={handleDrawerClose}></Drawer>
                <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
                    <DrawerHeader />
                    <Typography paragraph>
                        Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod
                        tempor incididunt ut labore et dolore magna aliqua. Rhoncus dolor purus non
                        enim praesent elementum facilisis leo vel. Risus at ultrices mi tempus
                        imperdiet. Semper risus in hendrerit gravida rutrum quisque non tellus.
                        Convallis convallis tellus id interdum velit laoreet id donec ultrices.
                        Odio morbi quis commodo odio aenean sed adipiscing. Amet nisl suscipit
                        adipiscing bibendum est ultricies integer quis. Cursus euismod quis viverra
                        nibh cras. Metus vulputate eu scelerisque felis imperdiet proin fermentum
                        leo. Mauris commodo quis imperdiet massa tincidunt. Cras tincidunt lobortis
                        feugiat vivamus at augue. At augue eget arcu dictum varius duis at
                        consectetur lorem. Velit sed ullamcorper morbi tincidunt. Lorem donec massa
                        sapien faucibus et molestie ac.
                    </Typography>
                    <Typography paragraph>
                        Consequat mauris nunc congue nisi vitae suscipit. Fringilla est ullamcorper
                        eget nulla facilisi etiam dignissim diam. Pulvinar elementum integer enim
                        neque volutpat ac tincidunt. Ornare suspendisse sed nisi lacus sed viverra
                        tellus. Purus sit amet volutpat consequat mauris. Elementum eu facilisis
                        sed odio morbi. Euismod lacinia at quis risus sed vulputate odio. Morbi
                        tincidunt ornare massa eget egestas purus viverra accumsan in. In hendrerit
                        gravida rutrum quisque non tellus orci ac. Pellentesque nec nam aliquam sem
                        et tortor. Habitant morbi tristique senectus et. Adipiscing elit duis
                        tristique sollicitudin nibh sit. Ornare aenean euismod elementum nisi quis
                        eleifend. Commodo viverra maecenas accumsan lacus vel facilisis. Nulla
                        posuere sollicitudin aliquam ultrices sagittis orci a.
                    </Typography>

                    {/* <Agencies drawerwidth={drawerWidth} open={open}></Agencies> */}
                    <Routes>
                        <Route path="/About" element={<About />} exact />

                        <Route path="/Login" element={<LoginRegistration />} />
                        <Route path="/Registration" element={<Registration />} exact />

                        <Route path="/Departments" element={<Departments />} exact />
                        <Route path="/Suppliers" element={<Suppliers />} exact />
                        <Route path="/Customers" element={<Customers />} exact />
                        <Route path="/Workers" element={<Workers />} exact />
                        <Route path="/Agencies" element={<Agencies drawerwidth={drawerWidth} open={open} />} exact />
                        <Route path="/Items" element={<Items />} exact />
                        <Route path="/Photos_Posters" element={<Photos_Posters />} exact />
                        <Route path="/Models" element={<Models />} exact />
                        <Route path="/Messages" element={<Messages />} exact />
                        <Route path="/Notifications" element={<Notifications />} exact />
                        {/* <Route path="/Settings" element={<Settings />} exact /> */}

                    </Routes>
                </Box>
            </Box>
            <Routes>
                <Route path="/Agencies" element={<Agencies drawerwidth={drawerWidth} open={open} />} exact />
            </Routes>
        </React.Fragment >

    );
};
export default Home;
